    private async void DisplayHighScoreInTextMesh()
    {
       var task = databaseAccess.GetScoresFromDataBase();
       var result = await task;
       var output = "";
        foreach(var score in result)
        {
          output += score.CharacterName + " Score: " + score.Score + " PlayerLevel: " + score.PlayerLevel + " WorldLevel: " + score.WorldLevel + "\n";
          Texture2D tex = new Texture2D(2, 2);         
          tex.LoadImage(score.ChampionImage);
          //image.GetComponent<Renderer>().material.mainTexture = tex;
          image.GetComponent<UnityImage>().material.mainTexture = tex;
        }

      //string imageByte = "";
      
        //byte[] bytes = Encoding.ASCII.GetBytes(imageByte);
      // Texture2D textureByte = (Texture2D) image.mainTexture;//new Texture2D(2, 2);
      //textureByte.LoadImage(bytes);
      // image.GetComponent<UnityImage>().material.mainTexture = textureByte;
      highScoreOutPut.text = output;
    }

    public Image BytesToImage(byte[] byteArray)
    {
      using (var ms = new MemoryStream(byteArray))
      {
        return Image.FromStream(ms);
      }
    }

    public byte[] ImageToBytes(Image image)
    {     
      using (var ms = new MemoryStream())
      {
        image.Save(ms, image.RawFormat);
        return ms.ToArray();
      }
    }
